import React,{useState} from "react"

function Products() {

    const [products,setProducts]=useState({
        age:10,
    })

function count() {
    setProducts(
        ...products,
        products.age + 1)
}
    return(
        <div>
            MY age is {products.age}
            <button onClick={count}>ok </button>
        </div>
    )
}





export default  Products;
